import { lazy } from "react";
import { Navigate } from "react-router-dom";

/****Layouts*****/
const FullLayout = lazy(() => import("../layouts/FullLayout"));

/***** Pages ****/

const Home = lazy(() => import("../views/Home"));
const Sell = lazy(() => import("../views/sell/Sell"));
const OpenClose = lazy(() => import("../views/sell/OpenClose"));
const SaleHistory = lazy(() => import("../views/sell/SaleHistory"));
const CashManagement = lazy(() => import("../views/sell/CashManagement"));




const Alerts = lazy(() => import("../views/ui/Alerts"));
const Badges = lazy(() => import("../views/ui/Badges"));
const Buttons = lazy(() => import("../views/ui/Buttons"));
const Cards = lazy(() => import("../views/ui/Cards"));
const Grid = lazy(() => import("../views/ui/Grid"));
const Tables = lazy(() => import("../views/ui/Tables"));
const Forms = lazy(() => import("../views/ui/Forms"));
const Breadcrumbs = lazy(() => import("../views/ui/Breadcrumbs"));
const Login = lazy(() => import("../auth/Login"));
const Register = lazy(() => import("../auth/Register"));

/*****Routes******/

const ThemeRoutes = [
  {
    path: "/",
    element: <FullLayout />,
    children: [
      { path: "/", element: <Navigate to="/Home" /> },
      // { path: "/login", exact: true, element: <Login /> },
      // { path: "/register", exact: true, element: <Register /> },
      { path: "/Home", exact: true, element: <Home /> },
      { path: "/Sell", exact: true, element: <Sell /> },
      { path: "/OpenClose", exact: true, element: <OpenClose /> },
      { path: "/SaleHistory", exact: true, element: <SaleHistory /> },
      { path: "/CashManagement", exact: true, element: <CashManagement /> },
      { path: "/alerts", exact: true, element: <Alerts /> },
      { path: "/badges", exact: true, element: <Badges /> },
      { path: "/buttons", exact: true, element: <Buttons /> },
      { path: "/cards", exact: true, element: <Cards /> },
      { path: "/grid", exact: true, element: <Grid /> },
      { path: "/table", exact: true, element: <Tables /> },
      { path: "/forms", exact: true, element: <Forms /> },
      { path: "/breadcrumbs", exact: true, element: <Breadcrumbs /> },
    ],
  },
];

export default ThemeRoutes;
